query:
SELECT DISTINCT ?uri 
WHERE {
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Person> . 
        ?uri <http://dbpedia.org/ontology/weight> ?num . 
      { ?uri <http://dbpedia.org/property/team> <http://dbpedia.org/resource/Chicago_Bulls> . }
      UNION 
      { ?uri <http://dbpedia.org/property/draftTeam> <http://dbpedia.org/resource/Chicago_Bulls> . }
      UNION 
      { ?uri <http://dbpedia.org/ontology/draftTeam> <http://dbpedia.org/resource/Chicago_Bulls> . }
} 
ORDER BY DESC(?num) 
OFFSET 0 LIMIT 1

SELECT DISTINCT ?uri
WHERE {
        ?uri <http://xmlns.com/foaf/0.1/surname> 'Baldwin'@en . 
      { ?uri dbo:occupation res:Actor . } 
      UNION 
      { ?uri rdf:type dbo:Actor . }
}

SELECT DISTINCT ?x
WHERE {
        ?uri <http://dbpedia.org/ontology/deathCause> ?x . 
}
ORDER BY DESC(COUNT(DISTINCT ?uri)) 
OFFSET 0 LIMIT 1

SELECT DISTINCT ?uri 
WHERE {
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Organisation> .
      { ?uri <http://dbpedia.org/ontology/formationYear> ?date . }
      UNION 
      { ?uri <http://dbpedia.org/ontology/foundingYear> ?date. }
      FILTER regex(?date,'^1930') . 
}

SELECT DISTINCT ?uri
WHERE {
        ?uri rdf:type <http://dbpedia.org/class/yago/StatesOfTheUnitedStates> .
        res:Mount_McKinley dbo:locatedInArea ?uri . 
}

SELECT DISTINCT ?uri
WHERE { 
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Airport> .
      { ?uri <http://dbpedia.org/ontology/location> <http://dbpedia.org/resource/California> . }
      UNION
      { ?uri <http://dbpedia.org/ontology/city> <http://dbpedia.org/resource/California> . } 
      UNION 
      { ?uri <http://dbpedia.org/ontology/city> ?city .
        ?city <http://dbpedia.org/ontology/isPartOf> <http://dbpedia.org/resource/California> . }
      UNION
      { ?uri <http://dbpedia.org/ontology/operator> <http://dbpedia.org/resource/California> . } 
}

SELECT DISTINCT ?uri
WHERE {
         ?uri <http://dbpedia.org/ontology/office> 'President of the United States' .
         ?uri <http://dbpedia.org/ontology/orderInOffice> '16th' .
}

SELECT DISTINCT ?uri
WHERE {
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Actor> .
      { ?uri <http://dbpedia.org/ontology/birthPlace> res:Germany . }
      UNION 
      { ?uri <http://dbpedia.org/ontology/birthPlace> ?place .
        ?place <http://dbpedia.org/ontology/country> res:Germany . }
}

SELECT DISTINCT ?uri 
WHERE { 
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> dbo:Company  .
        ?uri dbo:industry res:Aerospace . 
        ?uri dbo:industry res:Medicine .
}

SELECT DISTINCT ?uri
WHERE {
          ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Person> .
        { ?uri <http://dbpedia.org/ontology/office> 'Chancellor of Germany' . }
        UNION
        { ?uri <http://dbpedia.org/property/office> <http://dbpedia.org/resource/Chancellor_of_Germany> . }
}

SELECT COUNT(DISTINCT ?uri)
WHERE { 
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Company>  .
      { ?uri <http://dbpedia.org/ontology/industry> <http://dbpedia.org/resource/Advertising> } 
      UNION 
      { ?uri <http://dbpedia.org/ontology/industry> ?industry . 
        FILTER regex(?industry,'advertising','i') . }
}

SELECT COUNT(DISTINCT ?uri)
WHERE { 	
        ?uri  <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Organisation>  .
      { ?uri <http://dbpedia.org/ontology/industry> <http://dbpedia.org/resource/Telecommunication> . } 
      UNION 
      { ?uri <http://dbpedia.org/property/industry> ?industry . 
        FILTER (regex(?industry,'Telecommunications')) . }
      { ?uri <http://dbpedia.org/ontology/location> <http://dbpedia.org/resource/Belgium.> } 
      UNION 
      { ?uri <http://dbpedia.org/property/locationCountry> 'Belgium'@en . }
}


SELECT DISTINCT ?uri 
WHERE { 
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/StatesOfTheUnitedStates> . 
        ?uri <http://dbpedia.org/property/admittancedate> ?x . 
} ORDER BY DESC(?x) 
OFFSET 0 LIMIT 1


SELECT DISTINCT ?uri 
WHERE { 
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Automobile> . 
      { ?uri <http://dbpedia.org/ontology/assembly> <http://dbpedia.org/resource/Germany> . } 
      UNION 
      { ?uri <http://dbpedia.org/property/assembly> <http://dbpedia.org/resource/Germany> . } 
      UNION 
      { { ?uri <http://dbpedia.org/ontology/manufacturer> ?x . } 
        UNION 
        { ?uri <http://dbpedia.org/property/manufacturer> ?x . } 
        { ?x <http://dbpedia.org/ontology/location>Country> <http://dbpedia.org/resource/Germany> . } 
        UNION 
        { ?x <http://dbpedia.org/ontology/location> <http://dbpedia.org/resource/Germany> . } 
      } 
}


SELECT DISTINCT ?uri 
WHERE { 
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/River> . 
      { ?uri <http://dbpedia.org/ontology/length> ?l . } 
      UNION 
      { ?uri <http://dbpedia.org/property/length> ?l . } 
} 
ORDER BY DESC(?l) 
OFFSET 0 LIMIT 1


SELECT DISTINCT ?uri 
WHERE { 
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Country> . 
        ?cave <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Cave> . 
      { ?cave <http://dbpedia.org/ontology/location> ?uri . } 
      UNION 
      { ?cave <http://dbpedia.org/ontology/location> ?loc . 
        ?loc <http://dbpedia.org/ontology/country> ?uri . } 
} 
GROUP BY ?uri 
HAVING(COUNT(?cave) > 10)
